const express = require("express");
const router = express.Router();

const auth = require("../middlewares/authMiddleware");
const role = require("../middlewares/roleMiddleware");

const {
  createOrUpdateSubscriptionPlan,
  getSubscriptionPlans,

  createOrUpdateServicePlan,
  getServicePlan,

  extendPublisherSubscription,
  suspendPublisherSubscription
} = require("../controllers/adminSubscriptionController");

router.post("/plan", auth, role("admin"), createOrUpdateSubscriptionPlan);
router.get("/plan", auth, role("admin"), getSubscriptionPlans);

router.post("/service", auth, role("admin"), createOrUpdateServicePlan);
router.get("/service", auth, role("admin"), getServicePlan);

router.post("/extend/:publisherId", auth, role("admin"), extendPublisherSubscription);
router.post("/suspend/:publisherId", auth, role("admin"), suspendPublisherSubscription);

module.exports = router;
